import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

const App = () => {
    return (<>
        <nav class="navbar bg-light">
            <div class="container">
                <a class="navbar-brand" href="jj">
                    <img src="https://www.amfori.org/sites/default/files/webform/membership/logo/logo-ohne-kontur-1.gif" alt="Bootstrap" width="30" height="24" />
                </a>
            </div>
        </nav>
    </>)
}
export default App;
